AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAADeFgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAHEIRAFAKAb/8AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAN/+AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAG//AAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAADeFgAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAAHl"

				/>
			</video>
			<button id="play-video" class="play-now">
				<i class="fa-solid fa-play"></i>
				<i class="fa-solid fa-pause" style="display: none"></i>
			</button>
			<button id="download-btn" class="btn download-btn">Download Now</button>
			<div id="mute-button" class="btn mute-btn">
				<i class="fa-solid fa-volume-high"></i>
				<i class="fa-solid fa-volume-off" style="display: none"></i>
			</div>
		</div>
		<script>
			const video = document.getElementById("game-video");
			const playButton = document.getElementById("play-video");
			const volumeButton = document.getElementById("mute-button");
			const downloadButton = document.getElementById("download-btn");

			// Call gameReady method once resources are loaded
			window.addEventListener("load", () => {
				console.log("Game is ready");
				window.gameReady && window.gameReady();
			});
			function gameStart() {
				video.play();
			}
			// Play/Pause functionality with gameStart method
			playButton.addEventListener("click", () => {
				if (video.paused) {
					video.play();
					playButton.querySelector(".fa-play").style.display = "none";
					playButton.querySelector(".fa-pause").style.display = "block";
					// Trigger gameStart method
					window.gameStart && window.gameStart();
				} else {
					video.pause();
					playButton.querySelector(".fa-play").style.display = "block";
					playButton.querySelector(".fa-pause").style.display = "none";
				}
			});

			// Mute/Unmute functionality
			volumeButton.addEventListener("click", () => {
				video.muted = !video.muted;
				volumeButton.querySelector(".fa-volume-high").style.display =
					video.muted ? "none" : "block";
				volumeButton.querySelector(".fa-volume-off").style.display = video.muted
					? "block"
					: "none";
			});

			// Trigger gameEnd method when the video ends
			video.addEventListener("ended", () => {
				console.log("Game ended");
				window.gameEnd && window.gameEnd();
			});

			// Trigger CTA call method on Download Now button
			downloadButton.addEventListener("click", () => {
				console.log("Download button clicked");
				window.install && window.install();
			});

			// Global gameClose function to handle game closure
			function gameClose() {
				console.log("Game closed");
				window.gameClose && window.gameClose();
			}

			video.addEventListener("timeupdate", () => {
				console.log(video.currentTime);
				if (video.currentTime >= 1.4 && video.currentTime <= 1.8) {
					video.currentTime = 0.9;
					video.addEventListener("click", () => {
						video.currentTime = 1.9;
					});
				}
				if (video.currentTime >= 3.5 && video.currentTime <= 3.8) {
					video.currentTime = 3;
					video.addEventListener("click", () => {
						video.currentTime = 3.9;
					});
				}

				if (video.currentTime >= 5.7 && video.currentTime <= 5.8) {
					video.currentTime = 5.5;
					video.addEventListener("click", () => {
						video.currentTime = 0;
					});
				}
			});
		</script>
